import React, { useState, useEffect } from 'react';
import { Col, Row } from 'antd';
import './style-dragDrop.css';

export default function DragDrop(props) {
  return (
    <>
      <Row gutter={[0, 8]} style={{ paddingTop: `30px` }}>
        <Col
          xs={{ span: 10, offset: 1 }}
          sm={{ span: 10, offset: 1 }}
          md={{ span: 5, offset: 1 }}
          lg={{ span: 5, offset: 1 }}
        >
          <div className="DragDrop-title">
            <div>
              <h5>Applied</h5>
              <div className="DragDrop-BlueBox">5</div>
            </div>
          </div>

          <Row gutter={[0, 8]} style={{ paddingTop: `30px` }}>
            <Col
              xs={{ span: 10, offset: 1 }}
              sm={{ span: 10, offset: 1 }}
              md={{ span: 5, offset: 1 }}
              lg={{ span: 24, offset: 0 }}
            >
              <div className="DragDrop-cards">
                <div>
                  <div className="DragDrop-cards-title">
                    <div className="DragDrop-WhiteBox"></div>
                    <span>Shahd Bourini</span>
                    <br />
                    <p>Computer Engineer</p>
                  </div>
                </div>
              </div>
            </Col>
          </Row>
        </Col>

        <Col
          xs={{ span: 10, offset: 1 }}
          sm={{ span: 10, offset: 1 }}
          md={{ span: 5, offset: 0 }}
          lg={{ span: 5, offset: 0 }}
          className="DragDrop-col"
        >
          <div className="DragDrop-title">
            <div>
              <h5>Phone Screen</h5>
              <div className="DragDrop-BlueBox">5</div>
            </div>
          </div>
        </Col>

        <Col
          xs={{ span: 10, offset: 1 }}
          sm={{ span: 10, offset: 1 }}
          md={{ span: 6, offset: 0 }}
          lg={{ span: 5, offset: 0 }}
          className="DragDrop-col"
        >
          <div className="DragDrop-title">
            <div>
              <h5>Interview</h5>
              <div className="DragDrop-BlueBox">5</div>
            </div>
          </div>
        </Col>

        <Col
          xs={{ span: 10, offset: 1 }}
          sm={{ span: 10, offset: 1 }}
          md={{ span: 5, offset: 0 }}
          lg={{ span: 5, offset: 0 }}
          className="DragDrop-col"
        >
          <div className="DragDrop-title">
            <div>
              <h5>Hired</h5>
              <div className="DragDrop-BlueBox">5</div>
            </div>
          </div>
        </Col>
      </Row>
    </>
  );
}
